import React from "react";
import notes from "../notes";

notes.map((note) => {
  console.log(note.title);
  console.log(note.content);
});

function Note() {
  console.log(notes);
  return (
    <div className="note">
      <h1>{note.title}}</h1>
      <p>this is the note content</p>
    </div>
  );
}

export default Note;
